import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Login from './components/Login';
import Signup from './components/Signup';
import ExpenseList from './components/ExpenseList';
import AddExpense from './components/AddExpense';
import PrivateRoute from './PrivateRoute';

const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li><a href="/signup">Signup</a></li>
            <li><a href="/login">Login</a></li>
            <li><a href="/expenses">Expense List</a></li>
            <li><a href="/add-expense">Add Expense</a></li>
          </ul>
        </nav>
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/expenses" element={<PrivateRoute component={ExpenseList} />} />
          <Route path="/add-expense" element={<PrivateRoute component={AddExpense} />} />
          <Route path="*" element={<Navigate to="/expenses" />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
